import { NavLink } from "react-router-dom";

export function HomepageHeader() {
  return (
    <nav className="navbar navbar-expand-sm navbar-dark bg-dark fixed-top" id="main-nav">
      <div className="container">
        <h3 className="navbar-brand">
          Welcome to My Blog
        </h3>
      </div>
    </nav>
  );
}
